/**
 * @name Mic Muted Alarm
 * @author josh#7745
 * @description Customizable alarm that notifies you when your mic has been muted for a while.
 * @version 1.0.0
 */
module.exports = class YoureMuted {
    // Plugin meta information
    meta = {
        name: "YoureMuted"
    }

    // Settings storage. These are the default values until
    // the user changes them in the settings panel.
    settings = {
        secsMutedBeforeDingaling: 30,
        audioSource: DEFAULT_SOUNDS.ELEVATOR_DING,
        volume: 100,
        playWhenDeafened: false
    }

    /**
     * Log a nicely formatted message to the console, including the plugins name
     * @param {string} type One of debug, info, etc...
     * @param  {...any} message Message to log
     */
    log(type, ...message) {
        console[type](`%c[${this.meta.name}]%c`, "color: #3a71c1; font-weight: 700;", "", ...message);
    }

    /**
     * Called when the plugin is loaded.
     */
    start() {
        // Load settings
        Object.assign(this.settings, BdApi.loadData(this.meta.name, "settings"));

        // Pizazz
        BdApi.injectCSS(this.meta.name, `
        #muted-reminder-settings li {
            margin-left: 1em;
            padding-left: .5em;
        }

        #muted-reminder-settings li::marker {
            content: "\\2022";
            color: var(--header-secondary);
            display: inline-block;
            width: 1em;
        }
        `);

        // Setup audio
        this.reloadAudio();

        // Run main loop, which is just a little timer
        this.mainLoopInterval = setInterval(this.checkMuteButton.bind(this), 500);

        this.log("info", "Loaded");
    }

    /**
     * @returns True if user is currently muted, false otherwise
     */
    areWeMuted() {
        return (this.muteButton.getAttribute("aria-checked") === 'true');
    }

    /**
     * Function that arms/disarms the alert based on the state of the "Mute" UI button.
     */
    checkMuteButton() {
        // Find the mute button
        let muteButtons = document.querySelectorAll('[aria-label="Mute"]');
        if (muteButtons.length != 1) {
            throw "Failed to load. Couldn't find the mute button.";
        }
        const muteButton = muteButtons[0];

        // Little function to return true/false based on mute button state
        const areWeMuted = () => (muteButton.getAttribute("aria-checked") === 'true');

        // Initialize data if we haven't done so yet
        if (this.lastMutedState == undefined) {
            this.lastMutedState = areWeMuted();
        }

        // Only arm/disarm on rising/falling edge
        const newMutedState = areWeMuted();
        if (this.lastMutedState == newMutedState) {
            // do nothing; muted state hasn't changed
            return;
        }

        // Update the button state
        this.lastMutedState = newMutedState;

        // Arm/disarm alert
        if (newMutedState) {
            this.armAlert();
        } else {
            this.disarmAlert();
        }
    }
    
    /**
     * Called when the plugged is unloaded.
     */
    stop() {
        this.disarmAlert();
        clearInterval(this.mainLoopInterval);
        BdApi.clearCSS(this.meta.name);
        this.log("info", "Unloaded");
    }

    /**
     * Play the alert audio.
     */
    dingDong() {
        // Find the deafen button
        let deafenButtons = document.querySelectorAll('[aria-label="Deafen"]');
        if (deafenButtons.length != 1) {
            throw "Failed to load. Couldn't find the deafen button.";
        }
        const deafenButton = deafenButtons[0];
        const areWeDeafened = () => (deafenButton.getAttribute("aria-checked") === 'true');

        // Don't ding dong if we're deafened
        if (areWeDeafened() && this.settings.playWhenDeafened == false) {
            this.log("debug", "We're deafened - not playing alert.");
            return;
        }

        this.log("info", "Playing alert");
        this.dingDongAudio.play();
    }

    /**
     * Arm the alert interval timer.
     */
    armAlert() {
        if (this.mutedTimer == undefined) {
            this.mutedTimer = setInterval(this.dingDong.bind(this), this.settings.secsMutedBeforeDingaling * 1000);
            this.log("info", "Alert armed");
        }
    }

    /**
     * Disarm the alert interval timer if one is set.
     */
    disarmAlert() {
        if (this.mutedTimer != undefined) {
            this.log("info", "Alert disarmed");
            clearInterval(this.mutedTimer);
            delete this.mutedTimer;
        }
    }

    buildSetting(text, key, type, value, callback = () => {}) {
        const setting = Object.assign(document.createElement("div"), {className: "setting"});
        const labelEl = document.createElement("span");
        labelEl.style.color = "var(--header-secondary)";
        const label = Object.assign(labelEl, {innerHTML: text});
        const inputEl = document.createElement("input");
        inputEl.style.marginLeft = '2em';
        const input = Object.assign(inputEl, {type: type, name: key, value: value});
        if (type == "checkbox" && value) input.checked = true;
        input.addEventListener("change", () => {
            const newValue = type == "checkbox" ? input.checked : input.value;
            this.settings[key] = newValue;
            BdApi.saveData(this.meta.name, "settings", this.settings);
            callback(newValue);
        });
        setting.append(label, input);
        return [setting, inputEl];
    }

    reloadAudio() {
        this.log("info", "Reloading audio");
        this.dingDongAudio = new Audio(this.settings.audioSource);
        this.dingDongAudio.volume = this.settings.volume / 100;
    }

    /**
     * Creates the settings panel, allowing users to configure this plugin.
     * @returns UI element
     */
    getSettingsPanel() {
        // Create a settings panel
        const settingsPanel = document.createElement("div");
        settingsPanel.id = "muted-reminder-settings";

        // Allows user to configure how long before the alert plays
        const [secsMutedText, secsMutedInput] = this.buildSetting(
            "Seconds Before Notification",
            "secsMutedBeforeDingaling",
            "number",
            this.settings.secsMutedBeforeDingaling,
            (newValue) => {
                if (newValue > 0) {
                    // Re-arm the alert after delay has changed
                    this.disarmAlert();
                    this.checkMuteButton();
                }
            }
        );
        secsMutedInput.min = 1;

        // Allows user to configure the audio source
        const [soundSourceSetting, soundSourceInput] = this.buildSetting(
            "Alert Sound (URL or <a href='https://base64.guru/converter/encode/audio/mp3' target='_blank'>base64 encoded</a>)",
            "audioSource",
            "text",
            this.settings.audioSource,
            () => {
                // Update the audio source
                this.reloadAudio();
            }
        );

        // Add buttons to auto-fill sound source with default sounds
        const defaultSoundsList = document.createElement("ul");
        for (const [soundName, soundSource] of Object.entries(DEFAULT_SOUNDS)) {
            const friendlyName = (unfriendlyName) => {
                // 1) Replace all underscores with whitespace
                // 2) Convert to lower case
                // 3) Capitalize first character in string
                return unfriendlyName.replaceAll("_", " ").toLowerCase().replace(/^(.)/, (firstChar) => firstChar.toUpperCase());
            };

            const useThisSourceListItem = document.createElement("li");
            useThisSourceListItem.style.listStyleType = "circle";
            useThisSourceListItem.style.before
            const useThisSourceBtn = document.createElement("a");
            useThisSourceBtn.text = friendlyName(soundName);
            useThisSourceBtn.addEventListener("click", () => {
                soundSourceInput.value = soundSource;
                soundSourceInput.dispatchEvent(new Event('change'));
            });
            useThisSourceListItem.append(useThisSourceBtn);
            defaultSoundsList.append(useThisSourceListItem);
        }

        const [volumeControl, volumeControlInput] = this.buildSetting(
            "Volume (0-100)",
            "volume",
            "number",
            this.settings.volume,
            () => {
                // Update the audio source
                this.reloadAudio();
            }
        );
        volumeControlInput.min = 0;
        volumeControlInput.max = 100;

        // Add a button to test the soundSource
        const testButton = document.createElement("button");
        testButton.innerText = "Test the Alert";
        testButton.addEventListener("click", () => {
            this.dingDong();
        });

        // Allows user to configure the audio source
        const [playWhenDeafenedSetting, playWhenDeafenedInput] = this.buildSetting(
            "Play when deafened?",
            "playWhenDeafened",
            "checkbox",
            this.settings.playWhenDeafened,
            () => {}
        );

        // Add individual settings to the settings panel UI
        settingsPanel.append(
            secsMutedText,
            playWhenDeafenedSetting,
            volumeControl,
            soundSourceSetting,
            defaultSoundsList,
            testButton
        );
        return settingsPanel;
    }
}

// Built-in sounds. Placed at bottom of this file so they don't
// get in the way of the good stuff above. This var will be
// hoisted to the top.
const DEFAULT_SOUNDS = {
    ELEVATOR_DING: "data:audio/mpeg;base64,",
    CLOWN_HORN: "data:audio/mpeg;base64,",
};
